window.bookSummaryJSON = "<p>Born of war and kept young only by the darkest of magic, the Dark Prophet's most powerful priestess has returned to the Trafalgan Mountains to take control of the Black Lake's mindless evil. </p> <p>Now, with a growing army of the infested and dead under her power, she turns her gaze on Dremaldria. </p> <p>Fist's chances of helping his former tribe destroy the Black Lake are bleak at best. The combined help of the Academy and the Mage School may not be enough to help him defeat the Priestess of War. </p>"; 
